import React from "react";
import { Link, useLocation } from "react-router-dom";

function HeaderDate() {
  const { pathname } = useLocation();
  const headerData = [
    {
      title: "THIS WEEK",
      to: "/bookings/thisweek",
    },
    {
      title: "NEXT WEEK",
      to: "/bookings/nextweek",
    },
    {
      title: "WHOLE MONTH",
      to: "/bookings/wholemouth",
    },
  ];
  return (
    <div className="header-date">
      <ul className="text-24">
        {headerData.map((el) => (
          <Link to={el.to}>
            <li className={pathname === el.to ? "" : "opacity-50"}>
              {el.title}
            </li>
          </Link>
        ))}
      </ul>
    </div>
  );
}

export default HeaderDate;
